Заказчик вправе потребовать от участника подтвердить свои представленные данные. Подтверждение представленных данных должно быть осуществлено до выбора победителя конкурса путем предоставления соответствующих документов или сведений, запрошенных заказчиком.
Участник, не соответствующий требованиям, отказавшийся подтвердить или не подтвердивший свои данные, отстраняется заказчиком от дальнейшего участия в процедуре закупки. Его предложение отклоняется.
